import Col from 'react-bootstrap/Col';
import FloatingLabel from 'react-bootstrap/FloatingLabel';
import Form from 'react-bootstrap/Form';
import Row from 'react-bootstrap/Row';

function GeneralAndNewsletterForm() {
    return (
        <>
            <FloatingLabel
            controlId="nameinput"
            label="Name"
            className="mb-3">
                <Form.Control type="input" placeholder="Your name" />
            </FloatingLabel>

            <FloatingLabel
            controlId="emailinput"
            label="Email address"
            className="mb-3">
                <Form.Control type="email" placeholder="name@example.com" />
            </FloatingLabel>

            <FloatingLabel
            controlId="contactinput"
            label="Contact number"
            className="mb-3">
                <Form.Control type="input" placeholder="Your contact" />
            </FloatingLabel>

            <FloatingLabel controlId="commentsinput" label="Comments">
                <Form.Control
                as="textarea"
                placeholder="Leave a comment here"
                style={{ height: '100px' }}
                />
            </FloatingLabel>

        </>
    );
}

export default GeneralAndNewsletterForm;
